import React from 'react';
import styles from './Footer.module.css';

const footer = (props) => {
    const theme = props.theme;

    return (
        <div className={styles.footer} >
            <h3>LinkedIn</h3>
            <h3>GitHub</h3>
        </div>
    )
};

export default footer;
